import RecoveredDetail from "./RecoveredDetail";
import DeathDetail from "./DeathDetail";

export default function ProvinceSelector({ country }) {
    return (
        <div>
            <ConfirmedDetail
                url={`https://covid19.mathdro.id/api/countries/${country}/confirmed`}
            />
        </div>
    );
}
